Consider the given function for finding the element x in an sorted array of n integers:-
void findX(int arr[],int n,int x){
    int low=0;
    int high = n-1;
    int mid=(low+high)/2;
    while(arr[mid]!=x && low < high){
         mid=(low+high)/2;
        if(arr[mid] < x){
            low=mid;
        }
        else{
            high=mid;
        }
    }
    if(arr[mid]==x){cout<<"Element is present in the array";}
    else{
        cout<<"Element is not present in the array";
    }

}
